import React, { useEffect } from 'react';
import { useSelector } from 'react-redux';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const user = useSelector((state) => state.user); // Assuming you have user information in your Redux store
  const navigate = useNavigate();

  useEffect(() => {
    // Check if user role is customer
    if (user && user.role === 'customer') {
 
      navigate('/customer/dashboard');
    } else {
      // User is not a customer, redirect to appropriate page
      console.log('User is not a customer');
      navigate('/'); // Redirect to homepage or login page
    }
  }, [user, navigate]);
  return (
    <div className="dashboard">
      <div className="sidebar">
        <ul>
          <li>Dashboard</li>
          <li>Orders</li>
          <li>Profile</li>
          <li>Settings</li>
          <li>Logout</li>
        </ul>
      </div>
      <div className="container">
        <h1>Welcome to the Customer Dashboard!</h1>
        {/* Your content goes here */}
      </div>
    </div>
  );
};

export default Dashboard;
